  of Unmixed Young Groundwater (defined using chlorofluorocarbon-11 concentrations
  and tritium activities) in the Eagle River Watershed Valley-Fill Aquifer, Eagle
  County, North-Central Colorado, 2006-2007\",\n\t\"tracking_summary\": {\n\t\t\"total\":
